import React, { useEffect } from 'react';
import { Card, Button, CardTitle, CardText, Row, Col, Container, Table } from 'reactstrap';
import { connect } from 'react-redux';
import { loadItemsData } from '../../actions/items';
import { Item } from '../../reducers/types';

function Cart(props: any): JSX.Element {
	useEffect(() => {
		props.loadItemsData();
	}, []);

	console.log(props);

	return (
		<Container>
			<Row>
				<Table>
					<thead>
						<tr>
							<th>#</th>
							<th>First Name</th>
							<th>Last Name</th>
							<th>Username</th>
						</tr>
					</thead>
					<tbody>
						<tr>
							<th scope="row">1</th>
							<td>Mark</td>
							<td>Otto</td>
							<td>@mdo</td>
						</tr>
						<tr>
							<th scope="row">2</th>
							<td>Jacob</td>
							<td>Thornton</td>
							<td>@fat</td>
						</tr>
						<tr>
							<th scope="row">3</th>
							<td>Larry</td>
							<td>the Bird</td>
							<td>@twitter</td>
						</tr>
					</tbody>
				</Table>
			</Row>
		</Container>
	);
}

const mapStateToProps = (state: any) => {
	return {
		items: state.items.items
	};
};

export default connect(mapStateToProps, { loadItemsData })(Cart);
